import React, { Component } from "react";
import PT from "prop-types";

export default class DefaultProps extends Component {


  static propTypes = {
    num: PT.number,
    str:PT.string
  };

  render() {
    console.log(this.props)
    return <div>
      {this.props.num}
      {this.props.str}
    </div>;
  }
}
